columns_description:
The registration status of the attorney; valid values are:
•	Delinquent;
•	Deceased;
•	Incapacitated;
•	Resigned;
•	Resigned from bar - disciplinary reason;
•	Disbarred;
•	Due to Register;
•	Currently registered;
•	Due to reregister within 30 days of birthday;
•	Suspended.

Código de valores del Puntaje Sisben, Rango de los valores:
1: entre 0 y 10; 
2: entre 11 y 20; 
3: entre 21 y 30; 
4: Mayor a 31.
